import { NavLink } from "react-router-dom";
import Router from "./router/router";

function App() {
  return (
    <div>
      <NavLink to="/ethereum">Ethereum</NavLink>
      <NavLink to="/ethers">Ethers</NavLink>
      <Router />
    </div>
  );
}

export default App;
